import React from 'react';
import Nav from 'react-bootstrap/Nav';
import {navStyle} from '../css/navigationStyle';
import Button from 'react-bootstrap/Button';

class Navigation extends React.Component {

  render() {
    return (
      <div>
        <Nav style={navStyle} className="justify-content-end" activeKey="/home">
          <Nav.Item style={navStyle.color}>
            <Nav.Link href="/home">Financial Tools</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Wealth Management</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">About</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">Resources</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Button href="#">Login</Button>
          </Nav.Item>
          <Nav.Item>
            <Button href="#">Sign Up</Button>
          </Nav.Item>
        </Nav>
      </div>
    )
  }
}

export default Navigation;
